import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import { Menu, Button, Dropdown, Image } from 'semantic-ui-react'
import faker from 'faker'
import { connect} from 'react-redux'
import { firebaseConnect, isLoaded, isEmpty } from 'react-redux-firebase'
import { compose } from 'redux'

function MyProfile(props) {
    return (
        <span>
            <Image avatar src={props.photo} />
        </span>
    )
}

class Header extends Component {
    state = {}
    
    handleItemClick = (e, { name }) => this.setState({ activeItem: name })
    
    render() {
        const { auth } = this.props;
        const { activeItem } = this.state
        const userKey = Object.keys(window.localStorage).filter(item => item.startsWith('firebase:authUser'))[0];
        const user = userKey ? JSON.parse(localStorage.getItem(userKey)) : undefined;
        const isLogged = userKey ? true : false;
        const options = [
            { key: 'sign-out', text: 'Sign Out', icon: 'sign out', onClick: () => this.props.firebase.auth().signOut() }
        ]

        return (
            <Menu borderless size="large">
                <Menu.Item>
                    <img src="data:image/svg+xml;utf8;base64," />
                </Menu.Item>

                <Menu.Item
                    as={Link}
                    to='/'
                    name='explore'
                    active={activeItem === 'explore'}
                    onClick={this.handleItemClick}
                    >
                    Explore
                </Menu.Item>

                <Menu.Item
                    as={Link}
                    to='/jobs/new'
                    name='newJob'
                    active={activeItem === 'newJob'}
                    onClick={this.handleItemClick}
                >
                    Create a job
                </Menu.Item>

                {isLogged ? (
                    <Menu.Menu position='right'>
                        <Menu.Item>
                            <Dropdown loading trigger={<MyProfile photo={isLogged ? user.providerData[0].photoURL : faker.internet.avatar()} />} pointing='top' options={options} icon={null} />
                        </Menu.Item>
                    </Menu.Menu>
                ) : (
                    <Menu.Menu position='right'>
                        <Menu.Item
                            as={Link}
                            to='/login'
                            name='sign-in'
                            active={activeItem === 'sign-in'}
                            onClick={this.handleItemClick}
                            >
                            Login
                        </Menu.Item>

                        <Menu.Item
                            as={Link}
                            to='/signup'
                            name='sign-up'
                            active={activeItem === 'sign-up'}
                            onClick={this.handleItemClick}
                            >
                            Sign Up
                        </Menu.Item>
                    </Menu.Menu>
                )}

            </Menu>
        )
    }
}

export default compose(
    firebaseConnect(),
    connect(({ firebase: { auth } }) => ({ auth }))
)(Header)